class ContactInfo {
    constructor(name, phone, email, language, startTime, endTime) {
        this.name = name;
        this.phone = phone;
        this.email = email;
        this.language = language;
        this.startTime = startTime;
        this.endTime = endTime;
    }
}

module.exports={ContactInfo}
